def main(wf): field_gid = "{query}" task = json.loads(os.getenv("task"))
task_info = wf.stored_data("task_info") task_info[task["gid"]] = { "name": task["name"], "spent_hours_field_gid": field_gid, "spent_hours": get_field_value(task, field_gid), "start_timestamp": None, } wf.store_data("task_info", task_info) return 0
