import os, sys import time import json from workflow import Workflow3
def main(wf): task_gid = json.loads(os.getenv("task"))["gid"]
if wf.stored_data("task_history") is None: wf.store_data("task_history", [])
if wf.stored_data("task_info") is None: wf.store_data("task_info", {})
task_info = wf.stored_data("task_info") if task_gid not in task_info or "start_timestamp" not in task_info[task_gid]: sys.stdout.write("%init_task") return 0
if __name__ == "__main__": wf = Workflow3() sys.exit(wf.run(main))

import os, sys import time import json from workflow import Workflow3
def main(wf): task = json.loads(os.getenv("task")) task_info = wf.stored_data("task_info") if task_info[task["gid"]]["start_timestamp"] is None: task_info[task["gid"]]["start_timestamp"] = time.time() wf.store_data("task_info", task_info) sys.stdout.write(task["name"]) return 0 else: sys.stdout.write("This task is already running!") return 0
