import os, sys from workflow import Workflow3 from workflow.background import run_in_background from asana.api import create_task
EPSILON = float(os.getenv('EPSILON'))
def main(wf): token = wf.get_password('asana_personal_access_token') task_name = os.getenv('task_name') project_gid = wf.settings["project_gid"] create_task(token, {"name": task_name, 'projects': [project_gid], 'assignee': "me"})
# update task list run_in_background( 'update_tasks', [ '/usr/bin/python', wf.workflowfile('update_tasks.py') ] )
sys.stdout.write(task_name) return 0
if __name__ == "__main__": wf = Workflow3() sys.exit(wf.run(main))

import os, sys import json from workflow import Workflow3 from workflow.background import run_in_background from asana.api import complete_task from utils import get_token, get_default_workspace_gid, stop_task
EPSILON = float(os.getenv('EPSILON'))
def main(wf): token = get_token(wf) task = json.loads("{query}") query = task["name"] workspace_gid = get_default_workspace_gid(wf)
task_info = wf.stored_data("task_info")
if task_info is not None and task["gid"] in task_info: if task_info[task["gid"]]["start_timestamp"] is not None: elapsed_hours = stop_task(wf, task["gid"]) query = "{} (running for {:.1f} hours)".format(task["name"], elapsed_hours)
# clean task_info task_info = wf.stored_data("task_info") del task_info[task["gid"]] wf.store_data("task_info", task_info)
complete_task(token, task["gid"])
# update task list run_in_background( 'update_tasks', [ '/usr/bin/python', wf.workflowfile('update_tasks.py') ] )
sys.stdout.write(query) return 0
if __name__ == "__main__": wf = Workflow3() sys.exit(wf.run(main))

